import React from "react";

function Booknotes() {
  return (
    <div>
      <nav>
        <a href="/" className="navbar">
          BookNotes
        </a>
        <a
          href="/archives"
          className="btn btn-Light position-absolute top-0 start-80 translate-middle"
        >
          Archives
        </a>
      </nav>
    </div>
  );
}

export default Booknotes;
